const Index = () => (
  <div className="index-container">
    <h1>S Y R E</h1>
    <p>I t ' s &nbsp;&nbsp;&nbsp;&nbsp;O n l y &nbsp;&nbsp;&nbsp;&nbsp;A r t</p>
    <style jsx>{
      `
      * {
        font-family: Roboto;
        box-sizing: border-box;

      }

     h1, p {
       color: #f5f1d0
     }
     h1 {
       font-size: 3rem;
       margin: 0rem
     }
     p {
       margin-top: 0
     }
      .index-container {
        display: flex;
        flex-direction: column;
        align-items: center;
        background-color: #071a24;
        width: 100%
      }
      `
    }
    </style>
  </div>
)

export default Index
